import React from 'react';
import styled from 'styled-components';
import srcLogoGit from '../img/github.png';
import srcLogoDio from '../img/dio1.png';

const Footer = styled.footer`
background-color: #eee;
display: flex;
position: fixed;
bottom: 0;
left: 0;
justify-content: center;
align-items: center;
width: 100%;
height: 70px;
`

const FooterItem = styled.span`
font-size: 18px;
text-decoration: none;
color: #777777;
font-weight: bold;
`

const DioLogo = styled.img`
    width: 150px;
    height: 50px;
`;
const GitLogo = styled.img`
    width: 150px;
    height: 50px;
`;

export default function footer() {
  return(
      <React.Fragment>
        <Footer>
            <FooterItem><DioLogo src={srcLogoDio}/></FooterItem>
            <FooterItem><GitLogo src={srcLogoGit}/></FooterItem>
        </Footer>
      </React.Fragment>

  );
}
